import React from 'react'
import { Swiper, SwiperSlide } from 'swiper/react';
import { Navigation, Pagination} from 'swiper/modules';
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import aBirdImage from '../../assets/images/webp/a-bird.webp'
import aGirlImage from '../../assets/images/webp/a-girl.webp'
import butterflyImage from '../../assets/images/webp/butterfly-image.webp'
import multipleColorImage from '../../assets/images/webp/multiple-color-image.webp'

const SwiperSlider = () => {
  return (
    <div>
      <div className='con'>
        <Swiper className='max-w-[850px]'
          // modules={[Navigation, Pagination, Scrollbar, A11y]}
          spaceBetween={50}
          slidesPerView={2}
          navigation
          pagination={{ clickable: true }}
          scrollbar={{ draggable: true }}
        >
          <SwiperSlide><img src={aBirdImage} alt="bird" className='max-w-[437px] h-[315px]' /></SwiperSlide>
          <SwiperSlide><img src={aGirlImage} alt="bird" className='max-w-[437px] h-[315px]' /></SwiperSlide>
          <SwiperSlide><img src={butterflyImage} alt="bird" className='max-w-[437px] w-full h-[315px]' /></SwiperSlide>
          <SwiperSlide><img src={multipleColorImage} alt="bird" className='max-w-[437px] h-[315px]' /></SwiperSlide>
        </Swiper>
      </div>
   </div>
  )
}

export default SwiperSlider
